import React from "react";
import Header from "../../component/Header/Header";
import Table from "../../component/tabela/Calendar.js";

function Home() {
  return (
    <>
      <Header />
      <section>
        <div className="container">
          <h1>Calendario Semanal</h1>
          <Table></Table>
          </div>
      </section>
    </>
  );
}

export default Home;
